  {
    id : 2,
    task:"Get out of bed",
    deadline : "Wed Sep 13 2017"
  },
  {
    id : 3,
    task:"Get out of bed",
    deadline : "Wed Sep 13 2017"
  }
]

function App() {
  return (
    <div className = "App" >
     <h2>Todo List</h2>
     <RenderTodos todos= {todoArray}/>
    </div>
  );
}

export default App;
